import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-5145.4 Industrial hemp extract requirements.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5145.4.md","filePath":"vacode/3.2-5145.4.md"}'),n={name:"vacode/3.2-5145.4.md"},i=r('<h1 id="§-3-2-5145-4-industrial-hemp-extract-requirements" tabindex="-1">§ 3.2-5145.4 Industrial hemp extract requirements. <a class="header-anchor" href="#§-3-2-5145-4-industrial-hemp-extract-requirements" aria-label="Permalink to &quot;§ 3.2-5145.4 Industrial hemp extract requirements.&quot;">​</a></h1><p>A. An industrial hemp extract shall (i) be produced from industrial hemp grown in compliance with applicable law and (ii) notwithstanding any authority under federal law to have a greater concentration of tetrahydrocannabinol, have a tetrahydrocannabinol concentration of no greater than 0.3 percent.</p><p>B. In addition to the requirements of this chapter, an industrial hemp extract or food containing an industrial hemp extract shall comply with regulations adopted by the Board pursuant to § <a href="/vacode/3.2-5145.5/">3.2-5145.5</a>.</p><p>2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0659" target="_blank" rel="noreferrer">659</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0660" target="_blank" rel="noreferrer">660</a>.</p>',4),o=[i];function c(l,s,d,h,p,_){return t(),a("div",null,o)}const f=e(n,[["render",c]]);export{m as __pageData,f as default};
